import React from "react";
import {
  deleteAttributeService,
  updateAttributeService,
} from "../../../services/CRUD_categoryService";
import { handleDeleteOperation } from "../reusable_operations/DeleteOperation";

export const Operations_attributes = ({ rowData, data, setData }) => {
  const handleUpdateAttribute = async (id) => {
    const res = await updateAttributeService(id);
    try {
      console.log(res);
    } catch (error) {}
  };
  return (
    <>
      <i
        className="icon_product_table fas fa-edit text-warning mx-1 pointer has_tooltip"
        title="ویرایش محصول"
        onClick={() => {
          handleUpdateAttribute(rowData.id);
        }}
      ></i>
      <i
        className="icon_product_table fas fa-times text-danger mx-1 pointer has_tooltip"
        title="حذف محصول"
        onClick={() => {
          handleDeleteOperation(
            rowData.id,
            data,
            setData,
            deleteAttributeService
          );
        }}
      ></i>
    </>
  );
};
